import React from "react";
import Envelople from "../../Assets/envelope.png";
import "./Newsletter.css";
const Newsletter = () => {
  return (
    <div class="newsContainer">
      <form class="card-content">
        <div class="cardContainer">
          <div class="image"></div>
          <h1>Stay Updated</h1>
          <p>
            Subscribe to our newsletter and be the first to learn about new
            features.
          </p>
        </div>
        <div class="form-input">
          <label for="email"></label>
          <input type="email" placeholder="example@gmail.com"></input>
          <button
            class="subscribe-btn"
            onClick={() => alert("a dummy, No mail spamming here.")}
          >
            Subscribe
          </button>
        </div>
      </form>
    </div>
  );
};
export default Newsletter;
